import React from 'react';
import './NewsFeedRecentActivity.css';

const NewsFeedRecentActivity = () => {
    return (
        <div className="p-4">
            <h6 className="news-feed-title text-white pb-2">Recent Activity</h6>
            <div className="news-feed-left-center-container mt-3 py-1 ps-2">
                <p className="m-0 time"><small>10 hours ago</small></p>
                <p className="m-0 topic text-white">Commented on Video posted</p>
                <p className="m-0 from text-white">by <span>Atikul Jaman</span></p>
            </div>
            <div className="news-feed-left-center-container mt-3 py-1 ps-2">
                <p className="m-0 time"><small>10 hours ago</small></p>
                <p className="m-0 topic text-white">Liked on your post</p>
                <p className="m-0 from text-white">by <span>Jhankar Mahabub</span></p>
            </div>
            <div className="news-feed-left-center-container mt-3 py-1 ps-2">
                <p className="m-0 time"><small>10 hours ago</small></p>
                <p className="m-0 topic text-white">Shared your Video posted</p>
                <p className="m-0 from text-white">by <span>Samira Rahman</span></p>
            </div>

        </div>
    );
};

export default NewsFeedRecentActivity;
